/*! normalize.css v6.0.0 | MIT License | github.com/necolas/normalize.css */

button,
figure,
h1,
input,
optgroup,
select,
textarea {
    margin: 0
}

button,
hr,
input {
    overflow: visible
}

audio,
canvas,
progress,
video {
    display: inline-block
}

progress,
sub,
sup {
    vertical-align: baseline
}

[type=checkbox],
[type=radio],
legend {
    box-sizing: border-box;
    padding: 0
}

html {
    line-height: 1.15;
    -ms-text-size-adjust: 100%;
    -webkit-text-size-adjust: 100%
}

article,
aside,
details,
footer,
header,
menu,
nav,
section {
    display: block
}

h1 {
    font-size: 2em
}

figcaption,
figure,
main {
    display: block;
    font-size: .98em
}

hr {
    box-sizing: content-box;
    height: 0
}

code,
kbd,
pre,
samp {
    font-family: monospace, monospace;
    font-size: 1em
}

a {
    background-color: transparent;
    -webkit-text-decoration-skip: objects
}

abbr[title] {
    border-bottom: none;
    text-decoration: underline;
    text-decoration: underline dotted
}

b,
strong {
    font-weight: bolder
}

dfn {
    font-style: italic
}

mark {
    background-color: #ff0;
    color: #000
}

small {
    font-size: 80%
}

sub,
sup {
    font-size: 75%;
    line-height: 0;
    position: relative
}

sub {
    bottom: -.25em
}

sup {
    top: -.5em
}

audio:not([controls]) {
    display: none;
    height: 0
}

img {
    border-style: none
}

svg:not(:root) {
    overflow: hidden
}

button,
select {
    text-transform: none
}

[type=reset],
[type=submit],
button,
html [type=button] {
    -webkit-appearance: button
}

[type=button]::-moz-focus-inner,
[type=reset]::-moz-focus-inner,
[type=submit]::-moz-focus-inner,
button::-moz-focus-inner {
    border-style: none;
    padding: 0
}

[type=button]:-moz-focusring,
[type=reset]:-moz-focusring,
[type=submit]:-moz-focusring,
button:-moz-focusring {
    outline: ButtonText dotted 1px
}

legend {
    color: inherit;
    display: table;
    max-width: 100%;
    white-space: normal
}

textarea {
    overflow: auto
}

[type=number]::-webkit-inner-spin-button,
[type=number]::-webkit-outer-spin-button {
    height: auto
}

[type=search] {
    -webkit-appearance: textfield;
    outline-offset: -2px
}

[type=search]::-webkit-search-cancel-button,
[type=search]::-webkit-search-decoration {
    -webkit-appearance: none
}

::-webkit-file-upload-button {
    -webkit-appearance: button;
    font: inherit
}

summary {
    display: list-item
}

[hidden],
template {
    display: none
}




.marvel-device {
    display: inline-block;
    position: relative;
    box-sizing: content-box!important
}

.marvel-device .screen {
    width: 100%;
    position: relative;
    height: 100%;
    color: #fff;
    z-index: 2;
    text-align: center;
    display: block;
    -webkit-border-radius: 1px;
    border-radius: 1px;
    -webkit-box-shadow: 0 0 0 3px #111;
    box-shadow: 0 0 0 3px #111
}

.marvel-device .bottom-bar,
.marvel-device .top-bar {
    height: 3px;
    background: #000;
    width: 100%;
    display: block
}

.marvel-device .middle-bar {
    width: 3px;
    height: 4px;
    top: 0;
    left: 90px;
    background: #000;
    position: absolute
}

.marvel-device.htc-one {
    padding: 72px 25px 100px;
    max-width: 320px;
    height: 568px;
    background: #bebebe;
    -webkit-border-radius: 34px;
    border-radius: 34px
}

.marvel-device.htc-one:before {
    content: '';
    display: block;
    width: calc(100% - 4px);
    height: calc(100% - 4px);
    position: absolute;
    top: 2px;
    left: 2px;
    background: #adadad;
    -webkit-border-radius: 32px;
    border-radius: 32px
}

.marvel-device.htc-one:after {
    content: '';
    display: block;
    width: calc(100% - 8px);
    height: calc(100% - 8px);
    position: absolute;
    top: 4px;
    left: 4px;
    background: #eee;
    -webkit-border-radius: 30px;
    border-radius: 30px
}

.marvel-device.htc-one .top-bar {
    width: calc(100% - 4px);
    height: 635px;
    position: absolute;
    background: #424242;
    top: 50px;
    z-index: 1;
    left: 2px
}

.marvel-device.htc-one .top-bar:before {
    content: '';
    width: calc(100% - 4px);
    height: 100%;
    position: absolute;
    background: #000;
    top: 0;
    z-index: 1;
    left: 2px
}

.marvel-device.htc-one .speaker,
.marvel-device.htc-one .speaker:after {
    height: 16px;
    width: 216px;
    z-index: 2;
    margin-left: -108px;
    position: absolute
}

.marvel-device.htc-one .bottom-bar {
    display: none
}

.marvel-device.htc-one .speaker {
    display: block;
    top: 22px;
    left: 50%;
    background: radial-gradient(#343434 25%, transparent 50%), radial-gradient(#343434 25%, transparent 50%) 4px 4px;
    background-size: 4px 4px;
    background-position: top left
}

.marvel-device.htc-one .speaker:after {
    content: '';
    display: block;
    top: 676px;
    left: 50%;
    background: inherit
}

.marvel-device.htc-one .camera {
    display: block;
    position: absolute;
    top: 18px;
    right: 38px;
    background: #3c3d3d;
    -moz-border-radius: 100%;
    -webkit-border-radius: 100%;
    border-radius: 100%;
    width: 24px;
    height: 24px;
    z-index: 3
}

.marvel-device.htc-one .camera:before {
    width: 8px;
    height: 8px;
    background: #000;
    -moz-border-radius: 100%;
    -webkit-border-radius: 100%;
    border-radius: 100%;
    position: absolute;
    content: '';
    top: 50%;
    left: 50%;
    margin-top: -4px;
    margin-left: -4px
}

.marvel-device.htc-one .sensor,
.marvel-device.htc-one .sensor:after {
    display: block;
    position: absolute;
    background: #3c3d3d;
    width: 8px;
    height: 8px;
    z-index: 3
}

.marvel-device.htc-one .sensor {
    top: 29px;
    left: 60px;
    -moz-border-radius: 100%;
    -webkit-border-radius: 100%;
    border-radius: 100%
}

.marvel-device.htc-one .sensor:after {
    content: '';
    top: 0;
    right: 12px;
    -moz-border-radius: 100%;
    -webkit-border-radius: 100%;
    border-radius: 100%
}

.marvel-device.htc-one.landscape {
    padding: 25px 72px 25px 100px;
    height: 320px;
    width: 568px
}

.marvel-device.htc-one.landscape .top-bar {
    height: calc(100% - 4px);
    width: 635px;
    left: calc(100% - 685px);
    top: 2px
}

.marvel-device.htc-one.landscape .speaker {
    width: 16px;
    height: 216px;
    left: calc(100% - 38px);
    top: 50%;
    margin-left: 0;
    margin-top: -108px
}

.marvel-device.htc-one.landscape .speaker:after {
    width: 16px;
    height: 216px;
    left: calc(100% - 692px);
    top: 50%;
    margin-left: 0;
    margin-top: -108px
}

.marvel-device.htc-one.landscape .camera {
    right: 18px;
    top: calc(100% - 38px)
}

.marvel-device.htc-one.landscape .sensor {
    left: calc(100% - 29px);
    top: 60px
}

.marvel-device.htc-one.landscape .sensor:after {
    right: 0;
    top: -12px
}

body {
    text-align: center;
    font-family: sans-serif;
    font-size: .9em;
    background: #b5bdc8; /* Old browsers */
    background: -moz-linear-gradient(top, #b5bdc8 0%, #828c95 36%, #28343b 100%); /* FF3.6-15 */
    background: -webkit-linear-gradient(top, #b5bdc8 0%,#828c95 36%,#28343b 100%); /* Chrome10-25,Safari5.1-6 */
    background: linear-gradient(to bottom, #b5bdc8 0%,#828c95 36%,#28343b 100%); /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
    filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#b5bdc8', endColorstr='#28343b',GradientType=0 );
    background-size: 100%;
    background-attachment: fixed;
}

#offline {
    background-color: lavender !important;
}

p {
    margin: .25em
}

.row {
    -webkit-display: flex;
    -ms-display: flex;
    display: flex;
    margin-top: 1em
}

.icon {
    -webkit-flex: 1;
    -ms-flex: 1;
    flex: 1
}
.icon:hover {
    transform: scale(1.05);
}
.icon svg {
    max-width: 85%
}

.square {
    border-radius: 14%
}

.screen {
    background-color: #2a2228
}

.download {
    text-decoration: underline
}

a {
    color: #fff;
    text-decoration: none;
    outline: 0
}

#desktop-query {
    display: none;
}

#slack rect {mix-blend-mode:multiply}
